import React from "react";
import { Tile } from "../tile/Tile";


export const TileList = ({ contacts, appointments }) => {

  return (
    <div>
      {/* {
        contacts.map((contact, index) => {
          return (
            <Tile name={contact.name} email={contact.email} phone={contact.phone} key={index}/>
          )
        })
      } */}
      {
          appointments.map((appointment, index) => {
            return (
              <Tile title={appointment.title} contact={appointment.contact} date={appointment.date} time={appointment.date} key={index} />
            )
          })
      }
    </div>
  );
};
